Located in Jumeirah, its authentic food including vintage crockery and unique and insightful nods towards its history scattered around the walls really make you feel like you’re in a little village in Lebanon. 

We ordered the Hummous (one Beiruti and one with meat), a Fattouch salad, Patatas bravas and a Spicy Grilled Chicken breast. The hummous was smooth, the potatos crispy, the salad was fresh and tangy and the chicken grilled to perfection. Accompanied with a strawberry lemonade and what more could you want? 

There is also a selection of your usual shisha flavours- we went for our classic watermelon mint and although its not the best we’ve ever had it was good enough to want to come back...but probably more for the food! 

Check it out and let us know what you thought x TGID x

